import mixin from 'BlockChain-ui-privatization/PC/common-mixin/modules/trade/market/market';
import 'BlockChain-ui-privatization/PC/common-mixin/modules/trade/market/tradeMarket.styl';
export default {
  mixins: [mixin],
  mounted: function mounted() {
    this.init();
  },
  props: {
    showGridFlag: {
      default: false,
      type: Boolean
    }
  },
  data: function data() {
    return {
      coinTabs: [{
        label: this.$t('pageTitle.spot'),
        value: 'spot'
      }, {
        label: this.$t('pageTitle.futures'),
        value: 'futures'
      }],
      activeExchange: 'spot'
    };
  },
  computed: {
    linkurl: function linkurl() {
      if (this.$store.state.baseData.publicInfo) {
        return this.$store.state.baseData.publicInfo.url;
      }

      return {};
    }
  },
  methods: {
    handlerChangeTab: function handlerChangeTab(item) {
      var tradeUrl = '';
      var contractUrl = '';

      if (process.env.NODE_ENV === 'development') {
        tradeUrl = this.linkurl.exUrl ? '/ex/zh_CN/trade' : '';
        contractUrl = this.linkurl.coUrl ? '/co/zh_CN/trade' : '';
      } else {
        tradeUrl = this.linkurl.exUrl ? "".concat(this.linkurl.exUrl, "/").concat(this.$store.state.baseData.lan, "/trade") : '';
        contractUrl = this.linkurl.coUrl ? "".concat(this.linkurl.coUrl, "/").concat(this.$store.state.baseData.lan, "/trade") : '';
      }

      window.location.href = item.value === 'spot' ? tradeUrl : contractUrl;
    }
  }
};
